import React, { Component } from "react";

import "./sendItem.scss";

export default class SendItem extends Component {
  render() {
    return (
      <div className="send-add">
        <button className="submit-btn"
                onClick={() => {
                  this.props.handleChangeName(this.state.name)
                  this.props.handleChangeValue(this.state.value)
                }}
        >Send item</button>
      </div>
    );
  }
}
